import React from "react";

export default class PostItem extends React.Component{

    render() {
        const post = this.props.post;
        return (
            <div onClick={()=>{this.props.delete(this.props.id)}}>
                <input value={post.title}/>
                <input value={post.text}/>
            </div>
        );
    }
}
